/* eslint-disable no-unused-vars */
import React, { useState, useEffect } from "react";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Grid from "@mui/material/Grid";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import { Typography } from "@mui/material";
import DataTable from "react-data-table-component";
import UseGetRateIntegradores from "../hooks/UseGetRateIntegradores";
import ShippoRateFinales from "./ShippoRateFinales";

const ShippoItem = ({ datosfinales }) => {
  const { data, circle } = UseGetRateIntegradores(datosfinales);

  const columnas = [
    {
      name: "Carrier",
      selector: (row) => row.provider,
    },
    {
      name: "Currency",
      selector: (row) => row.currency_local,
    },
    {
      name: "Rate",
      selector: (row) => row.amount_local,
    },
    {
      name: "Service Level",
      selector: (row) => row.servicelevel,
    },
    {
      name: "Transit Time",
      selector: (row) => row.estimated_days,
    },

    {
      name: "",
      selector: (row) => (
        <img src={row.provider_image_75} alt="carrier" width="60" height="60" />
      ),
    },
  ];

  return (
    <>
      <Grid item xs={12}>
        {circle ? (
          "Loading ...."
        ) : (
          <Paper>
            <TableContainer component={Paper}>
              <Table size="small" aria-label="a dense table">
                <TableHead>
                  <TableRow>
                    <TableCell>Carrier</TableCell>
                    <TableCell align="right">Currency</TableCell>
                    <TableCell align="right">Rate</TableCell>
                    <TableCell align="right">Service Level</TableCell>
                    <TableCell align="right">Transit Time</TableCell>
                    <TableCell align="right" />
                  </TableRow>
                </TableHead>
                <TableBody>
                  {circle ? "Loading .." : data.map((datos) => (
                    <TableRow>
                      <TableCell component="th" scope="row">
                        {datos.provider}
                      </TableCell>
                      <TableCell align="right">
                        {datos.currency_local}
                      </TableCell>
                      <TableCell align="right">
                        {(datos.amount_local * 1).toFixed(2)}
                      </TableCell>
                      <TableCell align="right">{datos.servicelevel}</TableCell>
                      <TableCell align="right">
                        {datos.estimated_days} &nbsp; Days
                      </TableCell>
                      <TableCell align="right">
                        <img
                          src={datos.provider_image_75}
                          alt="Girl in a jacket"
                          width="60"
                          height="60"
                        />
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Paper>
        )}
      </Grid>
      <br />
    </>
  );
};

export default ShippoItem;
